"use strict";browser.runtime.onMessage.addListener(function(t,e){if("draftablePlayers"==t.cmd)return new Promise(function(e){var r=new Request("https://api.draftkings.com/draftgroups/v1/draftgroups/"+t.slateId+"/draftables?format=json",{method:"GET"});fetch(r).then(function(t){return t.text().then(function(t){e({slateHtml:t})})})})});